import React from 'react';
import './mystyle.css'
import "react-bootstrap";
import Button from 'react-bootstrap/Button';
import aboutPic from './HISTOPICTURE.png';

const About = () => {
    return (
        <div className="container-fluid bg-grey" id="about">
            <div className="row">
            <div className="col-sm-8">
                <h2>About this platform:</h2>
                <h4>This platform was made using d3.js which is a JavaScript library for manipulating documents based on Data.<br/>D3 helps you bring data to life using HTML, SVG and CSS.<br/>
                D3's emphasis on web standards gives you the full capabilities of modern browsers without tying yourself <br/>to a proprietary framework, combining powerful visualization components and a data-driven approach to <br/>DOM manipulation. </h4>
                <h5>This page was made by Alen Sudec, under the mentorship of doc.dr.sc Slobodan Jelić.</h5>
                
                
                
                <a href="https://hr.linkedin.com/in/alen-sudec-0805641a0">
                    <Button variant="danger">
							Get in touch
						</Button>
                </a>

                
            </div>
            <div className="col-sm-4">
                <img src={aboutPic } alt="histo"/>
            </div>
        </div>
        </div>
       
        
    )
}

export default About;
